contracts/kol-router/KOLRouterTraderJoe..content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.29;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./KOLSwapRouterBase.sol";
import "./interfaces/ILBRouter.sol";

/**
 * @title KOLRouterTraderJoe
 * @notice Router for KOLs that supports direct swaps via Trader Joe v1 and v2.x using ILBRouter.
 * @dev Handles both native and ERC20 swaps, applying a 2% fee split between KOL and Foundation.
 */
contract KOLRouterTraderJoe is KOLSwapRouterBase {
    using SafeERC20 for IERC20;

    /**
     * @dev Constructor that initializes the KOL router instance.
     * @param _kolAddress Address of the KOL associated with this router
     * @param _dexRouter Address of the Trader Joe UniversalRouter
     * @param _factoryAddress Address of the factory that deployed this router
     * @param _sherryFoundationAddress Address of Sherry Foundation
     * @param _sherryTreasuryAddress Address of Sherry Treasury
     */
    constructor(
        address _kolAddress,
        address _dexRouter,
        address _factoryAddress,
        address _sherryFoundationAddress,
        address _sherryTreasuryAddress
    )
        KOLSwapRouterBase(
            _kolAddress,
            _dexRouter,
            _factoryAddress,
            _sherryFoundationAddress,
            _sherryTreasuryAddress
        )
    {}

    /**
     * @notice Swap exact native tokens for ERC20 tokens.
     * @dev Deducts 2% fee and forwards the remaining native value to Trader Joe router.
     * @return amountOut The amount of tokens received from the swap.
     */
    function swapExactNATIVEForTokens(
        uint256 amountOutMin,
        ILBRouter.Path calldata path,
        address to,
        uint256 deadline
    ) external payable nonReentrant returns (uint256 amountOut) {
        require(msg.value > 0, "KOLSwapRouter: INVALID_INPUT_AMOUNT");

        NetAmount memory netAmountData = _deductFees(msg.value, address(0));

        amountOut = ILBRouter(dexRouter).swapExactNATIVEForTokens{
            value: netAmountData.netAmount
        }(amountOutMin, path, to, deadline);

        emit SwapExecuted(
            kolAddress,
            msg.sender,
            address(0),
            address(path.tokenPath[path.tokenPath.length - 1]),
            netAmountData.kolFee,
            netAmountData.foundationFee,
            netAmountData.treasuryFee
        );

        return amountOut;
    }

    /**
     * @notice Swap native tokens for exact ERC20 token amount.
     * @dev Deducts fees and refunds leftover AVAX if overpaid.
     * @return amountsIn Array containing input amounts per swap hop.
     */
    function swapNATIVEForExactTokens(
        uint256 amountOut,
        ILBRouter.Path calldata path,
        address to,
        uint256 deadline
    ) external payable nonReentrant returns (uint256[] memory amountsIn) {
        require(msg.value > 0, "KOLSwapRouter: INVALID_INPUT_AMOUNT");

        NetAmount memory netAmountData = _deductFees(msg.value, address(0));

        amountsIn = ILBRouter(dexRouter).swapNATIVEForExactTokens{
            value: netAmountData.netAmount
        }(amountOut, path, to, deadline);

        // Refund any unspent AVAX back to the user (after fees)
        if (netAmountData.netAmount > amountsIn[0]) {
            (bool success, ) = msg.sender.call{
                value: netAmountData.netAmount - amountsIn[0]
            }("");
            require(success, "KOLSwapRouter: REFUND_TRANSFER_FAILED");
        }

        emit SwapExecuted(
            kolAddress,
            msg.sender,
            address(0),
            address(path.tokenPath[path.tokenPath.length - 1]),
            netAmountData.kolFee,
            netAmountData.foundationFee,
            netAmountData.treasuryFee
        );

        return amountsIn;
    }

    /**
     * @notice Swap exact amount of ERC20 tokens for native tokens.
     * @dev Pulls tokens from user, deducts fees, approves DEX, and executes the swap.
     * @return amountOut The amount of native tokens received.
     */
    function swapExactTokensForNATIVE(
        uint256 amountIn,
        uint256 amountOutMinNATIVE,
        ILBRouter.Path calldata path,
        address payable to,
        uint256 deadline
    ) external nonReentrant returns (uint256 amountOut) {
        require(amountIn > 0, "KOLSwapRouter: INVALID_INPUT_AMOUNT");

        address inputToken = address(path.tokenPath[0]);

        // Transfer full amount from user
        IERC20(inputToken).safeTransferFrom(
            msg.sender,
            address(this),
            amountIn
        );

        // Deduct fees from the transferred amount
        NetAmount memory netAmountData = _deductFees(amountIn, inputToken);

        // Approve only the net amount for the swap
        IERC20(inputToken).approve(dexRouter, netAmountData.netAmount);

        amountOut = ILBRouter(dexRouter).swapExactTokensForNATIVE(
            netAmountData.netAmount,
            amountOutMinNATIVE,
            path,
            to,
            deadline
        );

        emit SwapExecuted(
            kolAddress,
            msg.sender,
            address(path.tokenPath[0]),
            address(path.tokenPath[path.tokenPath.length - 1]),
            netAmountData.kolFee,
            netAmountData.foundationFee,
            netAmountData.treasuryFee
        );

        return amountOut;
    }

    /**
     * @notice Swap up to a maximum amount of ERC20 tokens for a fixed amount of native tokens.
     * @return amountsIn Array containing input amounts per swap hop.
     */
    function swapTokensForExactNATIVE(
        uint256 amountOutNATIVE,
        uint256 amountInMax,
        ILBRouter.Path calldata path,
        address payable to,
        uint256 deadline
    ) external nonReentrant returns (uint256[] memory amountsIn) {
        require(amountInMax > 0, "KOLSwapRouter: INVALID_INPUT_AMOUNT");

        address inputToken = address(path.tokenPath[0]);

        // Transfer max amount from user
        IERC20(inputToken).safeTransferFrom(
            msg.sender,
            address(this),
            amountInMax
        );

        // Calculate net amount after fees
        NetAmount memory netAmountData = _deductFees(amountInMax, inputToken);

        // Approve the net amount for the swap
        IERC20(inputToken).approve(dexRouter, netAmountData.netAmount);

        amountsIn = ILBRouter(dexRouter).swapTokensForExactNATIVE(
            amountOutNATIVE,
            netAmountData.netAmount,
            path,
            to,
            deadline
        );

        emit SwapExecuted(
            kolAddress,
            msg.sender,
            address(path.tokenPath[0]),
            address(path.tokenPath[path.tokenPath.length - 1]),
            netAmountData.kolFee,
            netAmountData.foundationFee,
            netAmountData.treasuryFee
        );

        return amountsIn;
    }

    /**
     * @notice Swap exact amount of ERC20 tokens for another ERC20 token.
     * @return amountOut The amount of destination token received.
     */
    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        ILBRouter.Path calldata path,
        address to,
        uint256 deadline
    ) external nonReentrant returns (uint256 amountOut) {
        require(amountIn > 0, "KOLSwapRouter: INVALID_INPUT_AMOUNT");

        address inputToken = address(path.tokenPath[0]);

        // Transfer full amount from user
        IERC20(inputToken).safeTransferFrom(
            msg.sender,
            address(this),
            amountIn
        );

        // Deduct fees
        NetAmount memory netAmountData = _deductFees(amountIn, inputToken);

        // Approve net amount for swap
        IERC20(inputToken).approve(dexRouter, netAmountData.netAmount);

        amountOut = ILBRouter(dexRouter).swapExactTokensForTokens(
            netAmountData.netAmount,
            amountOutMin,
            path,
            to,
            deadline
        );

        emit SwapExecuted(
            kolAddress,
            msg.sender,
            address(path.tokenPath[0]),
            address(path.tokenPath[path.tokenPath.length - 1]),
            netAmountData.kolFee,
            netAmountData.foundationFee,
            netAmountData.treasuryFee
        );

        return amountOut;
    }

    /**
     * @notice Swap up to a maximum amount of ERC20 tokens to get a fixed amount of another ERC20 token.
     * @return amountsIn Array of token amounts used in the swap path.
     */
    function swapTokensForExactTokens(
        uint256 amountOut,
        uint256 amountInMax,
        ILBRouter.Path calldata path,
        address to,
        uint256 deadline
    ) external nonReentrant returns (uint256[] memory amountsIn) {
        require(amountInMax > 0, "KOLSwapRouter: INVALID_INPUT_AMOUNT");

        address inputToken = address(path.tokenPath[0]);

        // Transfer max amount from user
        IERC20(inputToken).safeTransferFrom(
            msg.sender,
            address(this),
            amountInMax
        );

        // Deduct fees from max amount
        NetAmount memory netAmountData = _deductFees(amountInMax, inputToken);

        // Approve net amount for swap
        IERC20(inputToken).approve(dexRouter, netAmountData.netAmount);

        amountsIn = ILBRouter(dexRouter).swapTokensForExactTokens(
            amountOut,
            netAmountData.netAmount,
            path,
            to,
            deadline
        );

        emit SwapExecuted(
            kolAddress,
            msg.sender,
            address(path.tokenPath[0]),
            address(path.tokenPath[path.tokenPath.length - 1]),
            netAmountData.kolFee,
            netAmountData.foundationFee,
            netAmountData.treasuryFee
        );

        return amountsIn;
    }

    /**
     * @dev Allows receiving native tokens (e.g., AVAX) in case of refund or dust from swaps.
     */
    receive() external payable {}
}

contracts/kol-router/KOLSwapRouterBase.s.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.29;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

// Interface for accessing factory fee settings
interface IKOLFactory {
    function getKOLFeeRate() external view returns (uint16);
    function getFoundationFeeRate() external view returns (uint16);
    function getTreasuryFeeRate() external view returns (uint16);
    function getBasisPoints() external view returns (uint16);
    function getTotalFeeRate() external view returns (uint16);
}

/**
 * @title KOLSwapRouterBase
 * @dev Abstract base contract for KOL routers with percentage-based fees
 */
abstract contract KOLSwapRouterBase is ReentrancyGuard {
    using Address for address;
    using SafeERC20 for IERC20;

    address public kolAddress;
    IKOLFactory public factory;
    address public dexRouter;
    address public sherryFoundationAddress;
    address public sherryTreasuryAddress;

    struct NetAmount {
        uint256 netAmount;
        uint256 kolFee;
        uint256 foundationFee;
        uint256 treasuryFee;
    }

    event SwapExecuted(
        address indexed kol,
        address indexed trader,
        address tokenIn,
        address indexed tokenOut,
        uint256 kolFee,
        uint256 foundationFee,
        uint256 treasuryFee
    );

    // Modifier to restrict access to KOL only
    modifier onlyKOL() {
        require(msg.sender == kolAddress, "Only KOL can call this function");
        _;
    }

    /**
     * @dev Constructor
     * @param _kolAddress Address of the KOL
     * @param _dexRouter Address of the DEX router
     * @param _factoryAddress Address of the factory
     * @param _sherryFoundationAddress Address of Sherry Foundation
     * @param _sherryTreasuryAddress Address of Sherry Treasury
     */
    constructor(
        address _kolAddress,
        address _dexRouter,
        address _factoryAddress,
        address _sherryFoundationAddress,
        address _sherryTreasuryAddress
    ) {
        require(_kolAddress != address(0), "Invalid KOL address");
        require(_dexRouter != address(0), "Invalid DEX router");
        require(_factoryAddress != address(0), "Invalid factory address");
        require(
            _sherryFoundationAddress != address(0),
            "Invalid foundation address"
        );
        require(
            _sherryTreasuryAddress != address(0),
            "Invalid treasury address"
        );

        kolAddress = _kolAddress;
        dexRouter = _dexRouter;
        factory = IKOLFactory(_factoryAddress);
        sherryFoundationAddress = _sherryFoundationAddress;
        sherryTreasuryAddress = _sherryTreasuryAddress;
    }

    /**
     * @dev Calculates and deducts fees from input amount
     * @param inputAmount The original input amount
     * @param tokenAddress Address of the token (address(0) for native)
     * @return netAmount Amount after fees deduction and fee data
     */
    function _deductFees(
        uint256 inputAmount,
        address tokenAddress
    ) internal returns (NetAmount memory) {
        uint16 kolFeeRate = factory.getKOLFeeRate();
        uint16 foundationFeeRate = factory.getFoundationFeeRate();
        uint16 treasuryFeeRate = factory.getTreasuryFeeRate();
        uint16 basisPoints = factory.getBasisPoints();

        uint256 kolFee = (inputAmount * kolFeeRate) / basisPoints;
        uint256 foundationFee = (inputAmount * foundationFeeRate) / basisPoints;
        uint256 treasuryFee = (inputAmount * treasuryFeeRate) / basisPoints;

        // Send foundation and treasury fee directly to respective addresses
        if (tokenAddress == address(0)) {
            // Native token
            (bool successF, ) = sherryFoundationAddress.call{
                value: foundationFee
            }("");
            require(successF, "KOLSwapRouter: FUNDATION_FEE_TRANSFER_FAILED");
            (bool successT, ) = sherryTreasuryAddress.call{value: treasuryFee}(
                ""
            );
            require(successT, "KOLSwapRouter: TREASURY_FEE_TRANSFER_FAILED");
        } else {
            // ERC20 token
            IERC20(tokenAddress).safeTransfer(
                sherryFoundationAddress,
                foundationFee
            );
            IERC20(tokenAddress).safeTransfer(
                sherryTreasuryAddress,
                treasuryFee
            );
        }

        uint256 netAmount = inputAmount - kolFee - foundationFee - treasuryFee;

        return
            NetAmount({
                netAmount: netAmount,
                kolFee: kolFee,
                foundationFee: foundationFee,
                treasuryFee: treasuryFee
            });
    }

    /**
     * @notice Calculates the net amount after deducting total fees from the given input amount.
     * @param _inputAmount The original amount before fees.
     * @return The net amount after fee deduction.
     */
    function calculateNetAmount(
        uint256 _inputAmount
    ) external view returns (uint256) {
        uint16 totalFeeRate = factory.getTotalFeeRate();
        uint16 basisPoints = factory.getBasisPoints();
        uint256 totalFee = (_inputAmount * totalFeeRate) / basisPoints;

        return _inputAmount - totalFee;
    }

    /**
     * @dev Allows the KOL to withdraw their accumulated fees for multiple tokens including native
     * @param tokenAddresses Array of token addresses (address(0) for native)
     */
    function withdrawKOLFees(
        address[] calldata tokenAddresses
    ) external onlyKOL nonReentrant {
        bool hasWithdrawn = false;

        // Always check and withdraw native tokens first if there's balance
        uint256 nativeAmount = address(this).balance;
        if (nativeAmount > 0) {
            (bool success, ) = kolAddress.call{value: nativeAmount}("");
            require(success, "Native fee withdrawal failed");
            hasWithdrawn = true;
        }

        // Withdraw specified ERC20 tokens
        for (uint256 i = 0; i < tokenAddresses.length; i++) {
            if (tokenAddresses[i] == address(0)) continue;

            uint256 amount = IERC20(tokenAddresses[i]).balanceOf(address(this));
            if (amount > 0) {
                IERC20(tokenAddresses[i]).safeTransfer(kolAddress, amount);
                hasWithdrawn = true;
            }
        }

        require(hasWithdrawn, "No fees to withdraw");
    }

    /**
     * @dev Get KOL fee balance for a specific token
     * @param tokenAddress Address of the token (address(0) for native)
     * @return Fee balance
     */
    function getKOLFeeBalance(
        address tokenAddress
    ) external view returns (uint256) {
        if (tokenAddress == address(0)) {
            return address(this).balance;
        } else {
            return IERC20(tokenAddress).balanceOf(address(this));
        }
    }

    /**
     * @dev Get KOL fee balances for multiple tokens
     * @param tokenAddresses Array of token addresses
     * @return balances Array of fee balances
     */
    function getKOLFeeBalances(
        address[] calldata tokenAddresses
    ) external view returns (uint256[] memory balances) {
        balances = new uint256[](tokenAddresses.length);
        for (uint256 i = 0; i < tokenAddresses.length; i++) {
            if (tokenAddresses[i] == address(0)) {
                balances[i] = address(this).balance;
            } else {
                balances[i] = IERC20(tokenAddresses[i]).balanceOf(
                    address(this)
                );
            }
        }
    }
}

